import React from 'react'
import "../styles/ChatScreen.css"
import Header from "../components/Header";
import ChatList from "../components/ChatList";
import ListItem from "../components/ListItem";

const online_items = [
    {user: "Jackie", timestamp: "", details: ""},
    {user: "Armin", timestamp: "", details: ""},
    {user: "Shreya", timestamp: "", details: ""},
    {user: "Ross", timestamp: "", details: ""},
    {user: "Alexa", timestamp: "", details: ""}
]

export default function ChatScreen() {
    return (
        <div className={"container"}>
            <Header text={"ChatRoom"}/>
            <div className={"main"}>
                <ChatList backgroundColor={"tomato"} width={"300px"} listItems={online_items}>
                    <Header text={"Online"}/>
                </ChatList>
                <ChatList backgroundColor={"gold"}/>
            </div>
        </div>
    )
}
